import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { Home, FileText, BarChart2, LogOut, LogIn, UserPlus, Github } from 'lucide-react';

const FloatingMenu = () => {
  const { isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <div className="fixed top-6 left-1/2 transform -translate-x-1/2 z-50">
      <div className="bg-slate-800/30 backdrop-blur-sm px-8 py-3 rounded-full border border-slate-700/30 shadow-lg hover:shadow-xl transition-all duration-300">
        <div className="flex items-center space-x-8">
          {isAuthenticated ? (
            (() => {
              const path = window.location.pathname;
              return (
                <>
                  <Link 
                    to="/" 
                    className={`flex items-center space-x-2 px-3 py-1 rounded-full transition-colors duration-200 ${path === '/' ? 'bg-indigo-800/40' : ''}`}
                  >
                    <div className={`p-2 rounded-full transition-colors duration-200 ${path === '/' ? 'bg-indigo-800/40' : 'bg-slate-700/30'}`}>
                      <Home className={`w-5 h-5 ${path === '/' ? 'text-indigo-400' : 'text-slate-300'}`} />
                    </div>
                    <span className={`text-sm font-medium ${path === '/' ? 'text-indigo-400 font-bold' : 'text-slate-300'}`}>Home</span>
                  </Link>
                  <Link 
                    to="/verify" 
                    className={`flex items-center space-x-2 px-3 py-1 rounded-full transition-colors duration-200 ${path === '/verify' ? 'bg-purple-800/40' : ''}`}
                  >
                    <div className={`p-2 rounded-full transition-colors duration-200 ${path === '/verify' ? 'bg-purple-800/40' : 'bg-slate-700/30'}`}>
                      <FileText className={`w-5 h-5 ${path === '/verify' ? 'text-purple-400' : 'text-slate-300'}`} />
                    </div>
                    <span className={`text-sm font-medium ${path === '/verify' ? 'text-purple-400 font-bold' : 'text-slate-300'}`}>Resume & Verify</span>
                  </Link>
                  <Link 
                    to="/analytics" 
                    className={`flex items-center space-x-2 px-3 py-1 rounded-full transition-colors duration-200 ${path === '/analytics' ? 'bg-pink-800/40' : ''}`}
                  >
                    <div className={`p-2 rounded-full transition-colors duration-200 ${path === '/analytics' ? 'bg-pink-800/40' : 'bg-slate-700/30'}`}>
                      <BarChart2 className={`w-5 h-5 ${path === '/analytics' ? 'text-pink-400' : 'text-slate-300'}`} />
                    </div>
                    <span className={`text-sm font-medium ${path === '/analytics' ? 'text-pink-400 font-bold' : 'text-slate-300'}`}>Analytics</span>
                  </Link>
                  <Link 
                    to="/github-analyzer" 
                    className={`flex items-center space-x-2 px-3 py-1 rounded-full transition-colors duration-200 ${path === '/github-analyzer' ? 'bg-gray-800/40' : ''}`}
                  >
                    <div className={`p-2 rounded-full transition-colors duration-200 ${path === '/github-analyzer' ? 'bg-gray-800/40' : 'bg-slate-700/30'}`}>
                      <Github className={`w-5 h-5 ${path === '/github-analyzer' ? 'text-white' : 'text-slate-300'}`} />
                    </div>
                    <span className={`text-sm font-medium ${path === '/github-analyzer' ? 'text-white font-bold' : 'text-slate-300'}`}>GitHub Analyzer</span>
                  </Link>
                  <button
                    onClick={handleLogout}
                    className={`flex items-center space-x-2 px-3 py-1 rounded-full transition-colors duration-200 ${path === '/logout' ? 'bg-red-800/40' : ''}`}
                  >
                    <div className={`p-2 rounded-full transition-colors duration-200 ${path === '/logout' ? 'bg-red-800/40' : 'bg-slate-700/30'}`}>
                      <LogOut className={`w-5 h-5 ${path === '/logout' ? 'text-red-400' : 'text-slate-300'}`} />
                    </div>
                    <span className={`text-sm font-medium ${path === '/logout' ? 'text-red-400 font-bold' : 'text-slate-300'}`}>Logout</span>
                  </button>
                </>
              );
            })()
          ) : (
            <>
              <Link 
                to="/" 
                className="group flex items-center space-x-2"
              >
                <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-indigo-500/20 transition-colors duration-200">
                  <Home className="w-5 h-5 text-slate-300 group-hover:text-indigo-400" />
                </div>
                <span className="text-sm font-medium text-slate-300 group-hover:text-indigo-400">Home</span>
              </Link>
              <Link 
                to="/login" 
                className="group flex items-center space-x-2"
              >
                <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-emerald-500/20 transition-colors duration-200">
                  <LogIn className="w-5 h-5 text-slate-300 group-hover:text-emerald-400" />
                </div>
                <span className="text-sm font-medium text-slate-300 group-hover:text-emerald-400">Login</span>
              </Link>
              <Link 
                to="/signup" 
                className="group flex items-center space-x-2"
              >
                <div className="p-2 rounded-full bg-slate-700/30 group-hover:bg-purple-500/20 transition-colors duration-200">
                  <UserPlus className="w-5 h-5 text-slate-300 group-hover:text-purple-400" />
                </div>
                <span className="text-sm font-medium text-slate-300 group-hover:text-purple-400">Sign Up</span>
              </Link>
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default FloatingMenu;
